import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container, Grid, TextField, Button, Typography, Paper, CircularProgress, Box
} from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import ErrorIcon from '@mui/icons-material/Error';
import './Predictor.module.css'; // Add custom styling

function HeartDisease() {
  const [inputData, setInputData] = useState({
    Age: '',
    Sex: '',
    ChestPainType: '',
    RestingBP: '',
    Cholesterol: '',
    FastingBS: '',
    RestingECG: '',
    MaxHR: '',
    ExerciseAngina: '',
    Oldpeak: '',
    ST_Slope: ''
  });
  const [result, setResult] = useState('');
  const [loading, setLoading] = useState(false);
  const [clicked, setClicked] = useState(false);
  const [history, setHistory] = useState([]);

  const handleChange = (event) => {
    setInputData({ ...inputData, [event.target.id]: event.target.value });
  };

  const handleSubmit = () => {
    setLoading(true);
    axios.post('http://localhost:5000/predict-heart-disease', inputData)
      .then(response => {
        setResult(response.data.result);
        setLoading(false);
        fetchHistory();
      })
      .catch(error => {
        console.error('Error predicting:', error);
        setLoading(false);
      });
  };

  const fetchHistory = () => {
    axios.get('http://localhost:5000/history-heart-disease')
      .then(response => {
        setHistory(response.data);
      })
      .catch(error => {
        console.error('Error fetching history:', error);
      });
  };

  useEffect(() => {
    fetchHistory();
  }, []);

  const handleClick = () => {
    setClicked(!clicked);
  };

  return (
    <>
      <nav>
        <a href="#">
          {/* Add your SVG logo or company logo here */}
        </a>
        <div>
          <ul id="navbar" className={clicked ? "active" : ""}>
            <li><a className="active" href="/userAcc">Back</a></li>
            <li><a href="/home">Logout</a></li>
          </ul>
        </div>
        <div id="mobile" onClick={handleClick}>
          <i id="bar" className={clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>

      <Container maxWidth="lg">
        <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
          <Typography variant="h4" align="center" gutterBottom style={{ fontWeight: 'bold' }}>
            Heart Disease Prediction
          </Typography>

          <form>
            <Grid container spacing={2}>
              {Object.keys(inputData).map((key) => (
                <Grid item xs={12} sm={6} key={key}>
                  <TextField
                    id={key}
                    label={key}
                    type="number"
                    variant="outlined"
                    fullWidth
                    value={inputData[key]}
                    onChange={handleChange}
                    InputLabelProps={{ shrink: true }}
                  />
                </Grid>
              ))}
            </Grid>

            <Box 
              display="flex" 
              justifyContent="center" 
              alignItems="center" 
              style={{ marginTop: '20px' }}
            >
              <Button
                variant="contained"
                color="primary"
                style={{ padding: '10px 20px', fontSize: '16px', fontWeight: 'bold' }}
                onClick={handleSubmit}
                disabled={loading}
              >
                {loading ? <CircularProgress size={24} /> : 'Predict'}
              </Button>
            </Box>
          </form>

          {result && (
            <Paper elevation={2} style={{ padding: '20px', marginTop: '20px', textAlign: 'center' }}>
              {result === '0' ? (
                <>
                  <CheckCircleIcon color="success" style={{ fontSize: 50 }} />
                  <Typography variant="h6" style={{ marginTop: '10px' }}>
                    No heart disease detected
                  </Typography>
                </>
              ) : (
                <>
                  <ErrorIcon color="error" style={{ fontSize: 50 }} />
                  <Typography variant="h6" style={{ marginTop: '10px' }}>
                    Heart disease detected
                  </Typography>
                </>
              )}
            </Paper>
          )}
        </Paper>
      </Container>
    </>
  );
}

export default HeartDisease;
